import React from 'react';
import '../styles.css';

function Contact() {
  return (
    <section id="contact" className="contact">
      <div className="container">
        <h2>Contact Us</h2>
        <p>Get in touch with us for more information or to schedule an appointment.</p>
      </div>
    </section>
  );
}

export default Contact;
